con:config.script:
def enterpriseResp = context.expand('${Query Enterprise#ResponseAsXml#//BodyEntry[@name="result"]/Content}')

// Remove the header part
// we are only interested in the second row which contains the data
enterpriseResp = enterpriseResp.split('\n')[1]

// The enterprise ID is the first entry in that row
def enterpriseID = enterpriseResp.split(';')[0]

log.info("Extracted enterprise ID: " + enterpriseID)
testRunner.testCase.testSuite.setPropertyValue('enterpriseID', enterpriseID)

def storeResp = context.expand('${Query Store#ResponseAsXml#//BodyEntry[@name="result"]/Content}')

// Remove the header part
// we are only interested in the second row which contains the data
storeResp = storeResp.split('\n')[1]

// The store ID is the second entry in that row
def storeID = storeResp.split(';')[1]

log.info("Extracted store ID: " + storeID)
testRunner.testCase.testSuite.setPropertyValue('storeID', storeID)

