con:configuration.scriptText:
def stockItemResp = context.expand('${StockItemAmountShouldDecrease#ResponseAsXml#//BodyEntry[@name="result"]/Content}')

// Remove the header part
// we are only interested in the second row which contains the data
stockItemResp = stockItemResp.split('\n')[1]

// The amount is in the ninth entry in that row
def stockItemAmount = stockItemResp.split(';')[8].toInteger()

log.info("Current amount: " + stockItemAmount)

def expectedAmount = context.expand('${#TestSuite#stockItemAmount}').toInteger() - 1

log.info("Expected amount: " + expectedAmount)

assert stockItemAmount == expectedAmount

